(function($){$.fn.slideshow=function(b){b=$.extend(b,{timeout:3e3,speed:400});return this.each(function(){var c=$(this);c.children().eq(0).appendTo(c).show();setInterval(function(){c.children().eq(0).hide().appendTo(c).fadeIn(b.speed)},b.timeout)})}})(jQuery);